    public static String responseFromGeoDBCity(ExecutorService threadPool, final Gson gson, String GEODBCITY_SERVER) throws Exception{
        long start = System.nanoTime();
        Callable<GeoCityDTO> task = new Callable<GeoCityDTO>(){
            @Override
            public GeoCityDTO call() throws Exception {
                String data = HttpUtils.fetchDataCity(GEODBCITY_SERVER);
                System.out.println("DATA: " + data);
                //AllDTO all = GSON.fromJson(data, AllDTO.class);
                GeoCityDTO geoCityDTO = GSON.fromJson(data, GeoCityDTO.class);
                System.out.println("DTO: " + geoCityDTO.data);
                return geoCityDTO;
            }
            
        };
        Future<GeoCityDTO> futureFact = threadPool.submit(task);
        
        GeoCityDTO geoDB = futureFact.get(30, TimeUnit.SECONDS);
        
        long end = System.nanoTime(); 
        String time = "Time Parallel: " + ((end-start)/1_000_000) + " ms.";
        
        StandartDTO sDTO = new StandartDTO(geoDB, time);
        
        String standartJSON = gson.toJson(sDTO);
        
        System.out.println(standartJSON);
        
        return standartJSON;
    }
    
